import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import logo from "../assests/logos1.png";

const Header = () => {
  return (
    <header>
      <Navbar bg="greay" variant="greay" expand="lg" collapseOnSelect>
        <Container>
          <Navbar.Brand>
            <img src={logo} alt="Brand logo" />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
                <h1>Find Your</h1>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
